import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  containerConfig: {
    backgroundColor:"#FFF2D8"
  },
  navConfig:{
    backgroundColor:'#d5ecb4'
  },
  inputConfig:{
    backgroundColor:'white',
    width:'100px',
    outlined:'gray'
  }
});
